def min_stamps(stamps, total):
    """"""
    dp = [float('inf')] * (total + 1)
    dp[0] = 0
    for i in range(1, total + 1):
        for stamp in stamps:
            if stamp <= i:
                dp[i] = min(dp[i], dp[i - stamp] + 1)
    return dp[total] if dp[total] != float('inf') else -1
